import '../css/registration.css';

function Registration() {
    function Submit(data) {
        if (data.target[2].value.lower() !== data.target[3].value.lower())
            alert('Пошел нахуй')
            return

        
    }

    return (
        <form className='form-registration' onSubmit={Submit}>
            <h3>username</h3>
            <input type='login'/>
            <h3>email</h3>
            <input type='email'/>
            <h3>password</h3>
            <input type='password'/>
            <h3>repeat password</h3>
            <input type='password'/>
            <button>Submit</button>
        </form>
    );
}

export default Registration;
